import React from "react";
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';

export default {
    name: 'Saidur Rahman',
    title: 'Full Stack Developer',

    birthday: 'February 5',
    email: 'saidur.rahmann@gmail.com',

    socials: {
        Linkedin: {
            link: "https://www.linkedin.com/in/saidur-rahman1/",
            text: "My LinkedIn",
            icon: <LinkedInIcon />
        },
        Github: {
            link: "https://www.github.com/saidur-rahman1",
            text: "My GitHub",
            icon: <GitHubIcon />
        }
    },

    about_me: '• Highly motivated and detail-oriented with over 6 years of experience in IT industry.' + <br /> +
    '• Strong foundation in web development and a passion for creating innovative and user-friendly applications.' + <br /> +
    '• Proficient in front-end stack such as HTML, CSS, JavaScript, React, Angular, Bootstrap and Material UI as well as back-end stack such as Java, Spring Boot, Node.js and Express.js.' + <br /> +
    '• Solid understanding of both SQL and NoSQL databases, RESTful APIs, and version control systems.' + <br /> +
    '• Experienced in developing web applications such as a web crawler and a photo sharing application for a private group and websites.' + <br /> +
    '• Experienced in providing cloud application support and performing data migrations.' + <br /> +
    '• Skilled in troubleshooting hardware and software problems.' + <br /> +
    '• Excellent problem-solving skills and a collaborative team player with strong communication abilities.' + <br /> +
    '• Knowledgeable in cloud platforms such as Amazon S3, AWS EC2, and Nginx server.'
}
